    URL pattern match generating the redirect request
    are provided as kwargs to this method.
    """
    if self.url:
        url = self.url % kwargs
    elif self.pattern_name:
        try:
            url = reverse(self.pattern_name, args=args, kwargs=kwargs)
        except NoReverseMatch:
            return None
